import React,{useState,useEffect} from "react";
import axios from 'axios';

const baseURL="http://localhost:8000/api/farming"



function Farming() {
   const [data,setData] = useState(null)

   useEffect(() => {
      axios.get(baseURL)
      .then((response)=> {
         setData(response.data)
      })
   })

   function showData() {
      console.log(data)
   }

   return (

        <h1 onClick={showData}>Farming</h1>

   ) 
}


export default Farming
